import React from "react";
import bgVideo from "../Images/rain.mp4";
import "./css/videoBg.css";

function VideoBgSection() {
  return (
    <div className="videoBg-div">
      <iframe
        width="697"
        height="392"
        src="https://www.youtube.com/embed/lMJXxhRFO1k"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
      {/* <video
        src="https://www.youtube.com/watch?v=lMJXxhRFO1k"
        autoPlay
        muted
        loop
        className="ms-auto"
      ></video> */}
      <div className="text-on-video text-white">
        <h2>HELLOOOO</h2>
      </div>
    </div>
  );
}

export default VideoBgSection;
